import { FETCH_OFFEXCHANGE_INDIVIDUAL } from "./types";
function updateOffExchangeIndividual(newValue) {
  return {
    type: FETCH_OFFEXCHANGE_INDIVIDUAL,
    payload: { offExchange: newValue }
  };
}
export default updateOffExchangeIndividual;
